import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import HomePage from './containers/homePage';

class App extends Component {  


  render(){
    return(
      <Router>
        <Route path="/" render={() => <HomePage/> } />
      </Router>
    );
  }
}

export default App;
